import React from "react";

const Table = ({ Event, Start, End, Duration, Id, Link }) => {
  return (
    <div>
      <div className="datatable-container">
        <table className="datatable">
          <tbody>
            <tr>
              <td>{Event}</td>
              <td>{Start}</td>
              <td>{End}</td>
              <td>{Duration}</td>
              <td>{Id}</td>
              <td>{Link}</td>
            </tr>
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default Table;
